def eventualSafeStates(graph):
    n=len(graph)
    visited=[0]*n
    safe=[]
    def dfs(node):
        if visited[node]==1:
            return False
        if visited[node]==2:
            return True
        visited[node]=1
        for nei in graph[node]:
            if not dfs(nei):
                return False
        visited[node]=2
        return True
    for i in range(n):
        if dfs(i):
            safe.append(i)
    return safe
